import "./Colaboradores.css";

const Colabolador = (props) =>{
    return <div className="colaborador">
        <div className="encabezado">
            <img src="https://github.com/SebastianGz301.png" alt="SebastianGz301"/>
        </div>
        <div className="info">
            <h4>Sebastian Gomez</h4>
            <h5>Desarrollador Front end</h5>
        </div>
    </div>
}

export default Colabolador;
